import React from "react";
import "./UserList.css";

const UserList = (props) => {
  const itemUser = props.items.map((item) => {
    return { userName: item.userName, age: item.age };
  });
  return (
    <div className="list-controler">
      {itemUser.userName + " " + itemUser.age}
    </div>
  );
};

export default UserList;
